import React from 'react';
import BotCard from './BotCard';

function YourBotArmy({ army, removeFromArmy, dischargeBot }) {
  return (
    <div>
      {army.map(bot => (
        <BotCard 
          key={bot.id} 
          bot={bot} 
          removeFromArmy={removeFromArmy} 
          dischargeBot={dischargeBot} 
          isInArmy
        />
      ))}
    </div>
  );
}

export default YourBotArmy;
